Last week @brianschaefer & @sambellipanni installed some fresh new ramp materials from @theramparmor and we had a handful of #SPoTTampa locals test it out. After a ton of power slides & a quick hubba session, the verdict is in...The locals back @theramparmor , especially the amount of grip the new ramp surface provides. 
.
Thanks to #RampArmor for sending the samples! Come test the new stuff out for yourself in the Pro Course today...
.
